import React from "react";
import Topo from "../../componentes/Topo";
import Rodape from "../../componentes/Rodape";

export default function sabores(){
    return(
            <div className="sabores">
                <Topo/>
                <section className="img-sabores">
                    <h2>NOSSOS SABORES</h2>
                </section>
                
                <Rodape/>
            </div>

    )
}
